import React from 'react';
import IndividaulBet from "./IndividaulBet";

const betList = () => {
	const betComponent = this.props.betArray.map((bet, i) => {
		return <IndividaulBet name = {this.props.betArray[i].description}/>

	})
	return(
		<div>
			{betComponent}
		</div>
	);

}

export default betList;
